import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import CategoryPopup from './components/CategoryPopup'

let selectedWord = '';
ReactDOM.render(
  <React.StrictMode>
  <CategoryPopup selectedWord={selectedWord} />
    <App selectedWord={selectedWord}/>
  </React.StrictMode>,
  document.getElementById('root')
);
